import React, { useState, useEffect } from 'react'
import MyHead from './MyHead'
import Result from './Result'

import NewPost from './NewPost'



const Home = () => {

    const [results, setResults] = useState([
        {
            author: "Steve",
            title: 'First Post',
            content: "Lots of stuff goes here",
            date: "2/1/2020",
            _id: 1

        },{
            author: "Steve",
            title: 'Second Post',
            content: "Second Post Content",
            date: "2/2/2020",
            _id: 2
        }
    ])

    // useEffect(() => {
    //     fetch('http://localhost:3000/api/blog').then(data => data.json()).then(data => setResults(data))
    // }, [])



    return(
    <div className ='container'>
        <MyHead pageName={'Home'} />

        <div className="flex mb-4 text-center">
            {results.map((post, index) => {
                return(
                <Result post = {post} key = {index}/>
                )
            })}
      </div>


        <NewPost updateList = {setResults} posts = {results}/>




    </div>
    )
}

